import React from 'react';
import logo from '../assets/logo.svg';
import '../css/App.css';
import {PowerBIEmbed} from "powerbi-client-react";
import {motion, useScroll, useSpring, useTransform, MotionValue} from 'framer-motion';
import { useRef } from 'react';

function Parallax(value: MotionValue<number>, distance: number) {
  return useTransform(value, [0, 1], [-distance, distance]);
}

function Slides({ id, imagePath }: { id: number, imagePath: string }) {
  const ref = useRef(null);
  const { scrollYProgress } = useScroll({ target: ref });
  const y = Parallax(scrollYProgress, 300);

  return (
    <motion.div ref={ref} style={{ y, marginBottom: '50px' }}>
      <img src={'imagePath'} alt={`Slide ${id}`} style={{ width: '100%', height: 'auto' }} />
    </motion.div>
  );
}
function App() {
  const images = [
    '../public/1.png',
    '../public/2.png',
    '../public/3.jpg',
    '../publuic/4.jpg',
    // Add more image paths as needed
  ];
  return (
    <div className="App">
      <header className="App-header">
          <p>The graph below is the embedded one.</p>
          {/* <div className="power_bi_graph">
              <iframe title="test_dashboard" width="600" height="373.5"
                      src="https://app.powerbi.com/view?r=eyJrIjoiNzY5NGIzNzAtMTdkNy00NGY4LThmMGQtYTliMjJjOGZiYzAwIiwidCI6Ijg1NjAyOTA4LWUxNWItNDNiYS05MTQ4LTM4YmM3NzNhODE2ZSIsImMiOjl9"
                      frameBorder="0" allowFullScreen={true}></iframe>
          </div> */}
          {images.map((imagePath, index) => (
          <Slides key={index} id={index + 1} imagePath={imagePath} />
        ))}
      </header>
    </div>
  );
}

export default App;
